/**
 * @param {number[]} arr
 * @return {number}
 */
 var oddEvenJumps = function(arr) {
    
    var smllestArr = new Array(arr.length);
    var largestArr = new Array(arr.length);
    for(var i=0; i<arr.length;i++){
        smllestArr[i] = JumpSmallest(i,arr);
        largestArr[i] = jumpLargest(i,arr);
    }



    var count = 0;
    var DP = new Array(2);
    for(var i=0; i<2;i++){
        var cols = new Array(arr.length);
        cols.fill(undefined);
        DP[i] = cols;
    }
    for(var i=0; i<arr.length;i++){
        
        if(jumper(i,arr,DP,smllestArr,largestArr))
            count++
    }
    return count;
}; 
function JumpSmallest(curr,arr){
    var min = Infinity;
    var minIndex = -1;
    for(var i=curr+1; i<arr.length;i++){
        
        if(i===curr)
            continue;

        if(arr[curr] <= arr[i] && arr[i] < min){
            min = arr[i];
            minIndex = i;
        }
    }
    return minIndex;
}
function jumpLargest(curr,arr){
    var max = -Infinity;
    var maxIndex = -1;
    for(var i=curr+1; i<arr.length;i++){
        
        if(i===curr)
            continue;

        if(arr[curr] >= arr[i] && arr[i] > max){
            max = arr[i];
            maxIndex = i;
        }
    }
    return maxIndex;
}
function jumper(start, arr,DP,smllestArr,largestArr)
{
    var jump = 1;
    
    if(start === arr.length-1)
        return true;
    if(DP[1][start]!=undefined)
        return DP[1][start];

    
    var stack = [];
    var success = true;
    while(start < arr.length-1){
        
        if(jump%2===0){
            if(DP[0][start]!=undefined){
                clearStack(DP,stack,DP[0][start]); 
                return DP[0][start];
            }
            stack.push([start,0]);
            jump++;
            //var next = jumpLargest(start,arr);
            var next = largestArr[start];
            if(next === -1){
                success = false;
                break;
            }
            
            start = next;
            
        }else{
            if(DP[1][start]!=undefined){
                clearStack(DP,stack,DP[1][start]); 
                return DP[1][start];
            }
            jump++;
            stack.push([start,1]);
            // var next = JumpSmallest(start,arr);
            var next = smllestArr[start];
            if(next === -1){
                success = false;
                break;
            }
            
            start = next;
        }
    }
    clearStack(DP,stack,success);
    return success;
}
function clearStack(DP,stack,success){
    while(stack.length>0){
        var node = stack.pop()
        DP[node[1]][node[0]] = success;
    }
}
